import React, {Component} from 'react';
import appstyles from './App.module.css';
import Button from './Button';
import { useNavigate } from 'react-router-dom';



function Home() {
	  const navigate = useNavigate();

		return (

			<section className={appstyles.container}>
				<ul>
					<li><a href="mailto:peter423@wwu.edu">Say Hello</a></li>
					<li><a href="mailto:peter423@wwu.edu">Blog</a></li>



					<li><span className={appstyles.logoname}>Starcoder.io</span></li>
					<img className="logo" src="star2.png"/>


				</ul>	
				<div className={appstyles.box}>
					<p>✨Code✨ the future with us without watching 30 hour tutorials</p> interesting projects
					<input></input>
					<input></input>
					<Button onClick={()=> navigate("interest")} title="Get Started" primary/>
				</div>
			</section>


		);


}


export default Home;
